import React, { useEffect, useState } from 'react'

const Rent = () => {
  const[units, setUnits] = useState([])
  useEffect(() => {
     fetch("/storage_units")
       .then((r) => r.json())
       .then((data) => setUnits(data));
  }, [])

  units.map((unit) => {
    if (unit.status == true) {
    return unit
  }
})

  return (
    <div>
      <h1>All Available units</h1>
      {units.map((cont) => (
        <div key={cont.id} className="container">
          <img src={cont.image_url} alt="container" />
          <div className="details">
            <p>
              <strong>SIZE:</strong> {cont.size}
            </p>
            <p>
              <strong>STATUS:</strong>{" "}
              {cont.status ? "Available" : null}
            </p>
          </div>
          <p id="price">
            <strong>PRICE:</strong>Ksh {cont.price} /=
          </p>
        </div>
      ))}
    </div>
  );
}

export default Rent
